import React,{useState} from 'react'
import '../../style/Header.css'
import Modal from 'react-modal';
export default function Header() {

Modal.setAppElement('#root');

  const[isLoginModalOpen, SetIsLoginModalOpen]=useState(false)


  const customStyles = {
    content: {
      top: '50%',
      left: '50%',
      right: 'auto',
      bottom: 'auto',
      marginRight: '-50%',
      transform: 'translate(-50%, -50%)',
    },
  };
  return (
    <div>
        <div className="header">
                <div className="s-logo">
                    <span>e!</span>
                </div>
                <div className="btn-group login-block">
                    <span className="Login" onClick={()=>SetIsLoginModalOpen(true)}>LogIn</span>
                    <span className="signUp">Create an account</span>
                    <Modal isOpen={isLoginModalOpen}>
                    style={customStyles}
                      <h2>Login Modal
                        <button className='btn btn-danger' style={{float:right}} onClick={()=>SetIsLoginModalOpen(false)}>X</button>
                      </h2>
                    </Modal>
                </div>
        </div>
    </div>
  )
}
